'’’ sql
SELECT ce.id, ce.class, ce.region, ce.startdate, ce.enddate, ce.buildfromzero, ce.confidence, ST_AsText(ce.geog) AS geometry_wkt FROM change_detection.change_events ce, locations_store WHERE ce.class = 'Residential' AND ce.buildfromzero=True AND ce.enddate >= date_trunc('year', now()) - interval '1 year' AND ST_DWithin(ce.geog::geography, locations_store."nabatieh_el_fawqa", 10000);
'’’

'’’ sql
SELECT ce.id, ce.class, ce.region, ce.startdate, ce.enddate, ce.buildfromzero, ce.confidence, ST_AsText(ce.geog) AS geometry_wkt FROM change_detection.change_events ce, locations_store WHERE ce.class = 'Industrial' AND ce.enddate >= date_trunc('month', now()) - interval '3 month' AND ST_DWithin(ce.geog::geography, locations_store."mazraat_el_bayad", 10000) AND ST_XMin(Box2d(ce.geog::geometry)) > ST_Xmax(box2d(locations_store."mazraat_el_bayad"));
'’’

'’’ sql 
SELECT ce.id, ce.class, ce.region, ce.startdate, ce.enddate, ce.buildfromzero, ce.confidence, ST_AsText(ce.geog) AS geometry_wkt FROM change_detection.change_events ce, locations_store WHERE ST_DWithin(ce.geog::geography, locations_store."sfenta", 1609.344) AND ce.buildfromzero=True;
'’’

'’’ sql 
SELECT ce.id, ce.class, ce.region, ce.startdate, ce.enddate, ce.buildfromzero, ce.confidence, ST_AsText(ce.geog) AS geometry_wkt FROM change_detection.change_events ce, locations_store WHERE (ce.class = 'Residential' OR ce.class = 'Highway' OR ce.class = 'Industrial') AND ce.enddate >= date_trunc('month', now()) - interval '6 month' AND ST_DWithin(ce.geog::geography, locations_store."manzala", 10000);
'’’

'’’ sql
SELECT ce.id, ce.class, ce.region, ce.startdate, ce.enddate, ce.buildfromzero, ce.confidence, ST_AsText(ce.geog) AS geometry_wkt FROM change_detection.change_events ce, locations_store WHERE ce.class IN ('Residential', 'Highway', 'Industrial') AND ce.buildfromzero=True AND ce.enddate >= date_trunc('year', now()) - interval '1 year' AND ST_DWithin(ce.geog::geography, locations_store."baassir", 10000) AND (ST_YMin(Box2d(ce.geog::geometry)) > ST_y(ST_Centroid(locations_store."baassir")) OR ST_YMax(Box2d(ce.geog::geometry)) < ST_y(ST_Centroid(locations_store."baassir")));
'’’

'’’ sql 
SELECT ce.id, ce.class, ce.region, ce.startdate, ce.enddate, ce.buildfromzero, ce.confidence, ST_AsText(ce.geog) AS geometry_wkt FROM change_detection.change_events ce, locations_store WHERE ce.class = 'Industrial' AND ce.enddate >= '2023-12-01' AND ce.enddate < '2024-01-01' AND ST_DWithin(ce.geog::geography, locations_store."zebdine", 10000); 
'’’
